.theme-one-dark-ui .tab-bar,
.theme-one-light-ui .tab-bar {
  font-size: 11px;
}
.theme-one-dark-ui .tab,
.theme-one-light-ui .tab {
  min-width: 10em;
  max-width: 16em;
}
.terminal-plus .xterm {
  background-color: #300A24;
}
atom-text-editor::shadow .comment {
  color: #cccc00;
}
atom-text-editor::shadow .punctuation.definition.comment {
  color: #cccc00;
}
